import React, { Component } from 'react'
import Button from 'react-bootstrap/Button';
import './Header.sass';

class Header extends Component {

    render() {
        const image =`./head1a.jpg`;
        const alt = '';
        return (
            <div id="home" className="App-header" style={headerStyle}>

                <h1 className="headerTitle">Software Development</h1>
                <div className="headerSubtitle">
                    <p className="subtitle">Turn your ideas into reality</p>
                </div>

                <Button className="contactButton" variant="primary" href='#contact'>
                    Contact
                </Button>

                <img src={image} alt={alt} style={imageStyle}/>

            </div>
        )
    }
}

const imageStyle={   

    objectFit: 'contain',
    opacity: 0.4
}

const headerStyle ={
    position: 'relative',
    display: 'flex',
    width: '100%',
    height: '82vh',
    marginTop: '50px',
    background: '#000',
}

export default Header;
